import React from 'react';
import './article.css'

const Article = (props) => {
    return (
        <div className='gpt3__blog-container_articles'>
            <div className='gpt3__blog-container_articles-image'>
                <img src={props.imgUrl} alt="" />
           </div>
        </div>
    );
};

export default Article;
